import { useRef, useState, useEffect } from "react";
import DropSlot from "./DropSlot";
import './OcrSlot.css'

function OCRSlot(index) {
  return (
    <div className="ocr-body">
      <div className="ocr-input-slot" tabIndex={index}>
      </div>
      <DropSlot/>
    </div>
  );
}

export default OCRSlot;
